import {Component} from '@angular/core';
import {HttpClient} from '@angular/common/http';
import { SymbolSearchServiceService } from './symbol-search-service.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})

export class AppComponent{
  title = 'Homework4';
  starter_url = 'https://www.alphavantage.co/query?function=';
  stock_symbol = '';
  url = '';
  api_key = 'XGN36Q0ICTGL1ZWD';
  show_chart = false;
  chartData: Object = [];
  constructor(private http: HttpClient,
              public symbolSearchService: SymbolSearchServiceService) { } // used to access the service methods

  generateStockUrl(){
   // console.log("generateStockUrl() called");
    this.url = this.starter_url + 'TIME_SERIES_INTRADAY&symbol=' + this.stock_symbol + '&interval=5min&apikey=' + this.api_key;
  //  console.log("URL", this.url)

    this.http.get(this.url).subscribe((data) => {
      this.chartData = data;
      console.log("CHART DATA: ", this.chartData);
      this.show_chart = true;

  });
}

}
